PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "plays" (
	"id"	INTEGER,
	"date"	TEXT,
	"away_team"	TEXT,
	"home_team"	TEXT,
	"home_spread"	REAL,
	"home_spread_price"	INTEGER,
	"away_moneyline"	INTEGER,
	"home_moneyline"	INTEGER,
	"bet"	TEXT,
	"wager"	REAL,
	"away_score"	INTEGER,
	"home_score"	INTEGER,
	"result"	TEXT,
	"profit"	INTEGER,
	"total_plays"	INTEGER,
	"total_wins"	INTEGER,
	"total_losses"	INTEGER,
	"total_pushes"	INTEGER,
	"total_profit"	INTEGER,
	"total_ats"	INTEGER,
	"total_moneyline"	INTEGER,
	"total_moneyline_wins"	INTEGER,
	"total_moneyline_losses"	INTEGER,
	"total_moneyline_pushes"	INTEGER,
	"total_moneyline_profit"	INTEGER,
	"total_ats_wins"	INTEGER,
	"total_ats_losses"	INTEGER,
	"total_ats_pushes"	INTEGER,
	"total_ats_profit"	INTEGER,
	"total_2u_wins"	INTEGER,
	"total_2u_losses"	INTEGER,
	"total_2u_pushes"	INTEGER,
	"total_2u_profit"	INTEGER,
	PRIMARY KEY("date","bet")
);
COMMIT;
